circ;ng biết c&aacute;ch vận dụng thiết kế c&oacute; thể l&agrave;m hỏng cả kh&ocirc;ng gian, bố cục căn nh&agrave; v&agrave; phải tốn tiền chỉnh sửa.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/web/uploads/images/7.jpg\" style=\"height:600px; width:800px\" /></p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>2) Nếu bạn kh&ocirc;ng biết c&aacute;ch dự tr&ugrave; chi ph&iacute; x&acirc;y nh&agrave; :</strong>&nbsp;bạn c&oacute; thể sẽ phải đi vay tiền để ho&agrave;n th&agrave;nh căn nh&agrave;. Việc vay tiền n&agrave;y c&oacute; thể ảnh hưởng đến vấn đề t&agrave;i ch&iacute;nh của nh&agrave; bạn. Ngo&agrave;i ra, việc dự tr&ugrave; chi ph&iacute; x&acirc;y dựng kh&ocirc;ng tốt c&oacute; thể khiến bạn bỏ qua việc thương lượng với người b&aacute;n đất về chi ph&iacute; khi phải gia cố m&oacute;ng tr&ecirc;n v&ugrave;ng đất yếu, hoặc bỏ qua chi ph&iacute; đảm bảo chất lượng cho căn nh&agrave; của m&igrave;nh như chi ph&iacute; thiết kế v&agrave; gi&aacute;m s&aacute;t. Chi ph&iacute; để khắc phục chất lượng k&eacute;m sau khi thi c&ocirc;ng c&oacute; thể chiếm từ&nbsp;<strong>10% - 20%</strong>&nbsp;gi&aacute; trị căn nh&agrave; của bạn.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>3) Nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; thiết kế :&nbsp;</strong>nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; thiết kế ngay từ ban đầu, c&oacute; thể bạn sẽ phải tốn th&ecirc;m từ&nbsp;<strong>10% - 20%</strong>&nbsp;cho chi ph&iacute; thiết kế v&igrave; việc l&agrave;m lại. Ngo&agrave;i ra, việc l&agrave;m lại thiết kế c&oacute; thể ảnh hưởng đến hiệu quả c&ocirc;ng việc của người l&agrave;m thiết kế bởi v&igrave; thực sự kh&ocirc;ng c&oacute; c&ocirc;ng việc g&igrave; ch&aacute;n ng&aacute;n hơn l&agrave; phải sửa đi, sửa lại một sản phẩm do m&igrave;nh l&agrave;m ra. Chưa kể c&ograve;n ảnh hưởng đến quan hệ giữa chủ nh&agrave; v&agrave; b&ecirc;n thiết kế nếu như &yacute; kiến của bạn thay đổi li&ecirc;n tục. Cho n&ecirc;n, bạn cần c&oacute; một bộ thư viện mẫu nh&agrave; để tham khảo trước khi bắt đầu l&agrave;m việc với thiết kế về căn nh&agrave; của m&igrave;nh. Khi đ&oacute;, những &yacute; tưởng về căn nh&agrave; của bạn sẽ trở n&ecirc;n r&otilde; r&agrave;ng hơn rất nhiều.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>4) Nếu bạn kh&ocirc;ng biết c&aacute;ch đ&aacute;nh gi&aacute; chọn thầu :</strong>&nbsp;kh&ocirc;ng c&oacute; g&igrave; sai lầm hơn việc chọn phải một nh&agrave; thầu thiết kế / thi c&ocirc;ng / gi&aacute;m s&aacute;t tệ hại. Kết quả của việc đ&aacute;nh gi&aacute; v&agrave; chọn thầu sai sẽ dẫn đến c&ocirc;ng tr&igrave;nh của bạn bị ảnh hưởng về nhiều kh&iacute;a cạnh như ph&aacute;t sinh chi ph&iacute;, tiến độ k&eacute;o d&agrave;i, chất lượng kh&ocirc;ng đảm bảo... Việc khắc phục những hệ lụy n&agrave;y kh&ocirc;ng bao giờ l&agrave; nhỏ. Thậm ch&iacute; c&oacute; trường hợp phải ti&ecirc;u tốn từ&nbsp;<strong>20% - 30%</strong>gi&aacute; trị căn nh&agrave; để khắc phục.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>5) Nếu bạn kh&ocirc;ng biết l&agrave;m r&otilde; hợp đồng :</strong>&nbsp;nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; hợp đồng, chắc chắn khi c&oacute; sự cố hoặc khi nh&agrave; thầu cố &yacute; &quot;l&agrave;m m&igrave;nh l&agrave;m mẩy&quot; th&igrave; bạn sẽ l&agrave; người chịu thiệt. Bạn sẽ l&agrave;m g&igrave; nếu nh&agrave; thầu l&agrave;m chậm tiến độ m&agrave; trong thỏa thuận th&igrave; chẳng c&oacute; điều kiện g&igrave; để r&agrave;ng buộc ? Bạn sẽ l&agrave;m g&igrave; nếu bạn muốn ngưng hợp đồng v&igrave; nh&agrave; thầu l&agrave;m việc kh&ocirc;ng đảm bảo chất lượng ? Chắc chắn những trường hợp đ&oacute; sẽ l&agrave;m mệt mỏi cả đ&ocirc;i b&ecirc;n nếu kh&ocirc;ng được quy định trước, đồng thời bạn c&ograve;n phải chịu thiệt về tiền bạc, thời gian nếu kh&ocirc;ng chuẩn bị kỹ c&agrave;ng.</p>\r\n</blockquote>\r\n\r\n<blockquote><strong>6) Nếu bạn kh&ocirc;ng biết những kh&acirc;u quan trọng cần phải kiểm tra :&nbsp;</strong>c&oacute; thể nh&agrave; thầu / gi&aacute;m s&aacute;t sẽ qua mặt bạn, v&igrave; đơn giản chỉ l&agrave; bạn kh&ocirc;ng biết. Hoặc sự sơ s&oacute;t, thiếu cẩn trọng của nh&agrave; thầu / gi&aacute;m s&aacute;t c&oacute; thể l&agrave;m ảnh hưởng đến chất lượng c&ocirc;ng tr&igrave;nh nếu bỏ qua một v&agrave;i kh&acirc;u quan trọng. Việc bạn biết những kh&acirc;u quan trọng cần kiểm tra khiến cho nh&agrave; thầu / gi&aacute;m s&aacute;t phải nể bạn hơn v&agrave; phải kỹ lưỡng hơn trong to&agrave;n bộ c&ocirc;ng tr&igrave;nh. Điều đ&oacute; gi&uacute;p cho c&ocirc;ng tr&igrave;nh của bạn chắc chắn &iacute;t sai s&oacute;t hơn v&agrave; chất lượng đảm bảo hơn.</blockquote>\r\n\r\n<blockquote><strong>7) Nếu bạn kh&ocirc;ng biết về những quy định khi x&acirc;y nh&agrave; :</strong>&nbsp;c&oacute; thể bạn sẽ phải chi ti&ecirc;u nhiều hơn cho việc x&acirc;y nh&agrave; của m&igrave;nh trong trường hợp lỡ như bạn x&acirc;y nh&agrave; bị kh&aacute;c với giấy ph&eacute;p được cấp. C&oacute; nhiều trường hợp, thậm ch&iacute; nh&agrave; thầu cũng kh&ocirc;ng nắm r&otilde; luật quy định về việc x&acirc;y dựng kh&aacute;c với giấy ph&eacute;p. Trong một số trường hợp bạn bị phạt h&agrave;nh ch&iacute;nh, phải ph&aacute; dỡ phần x&acirc;y tr&aacute;i ph&eacute;p ; một số trường hợp kh&aacute;c bạn chỉ bị phạt h&agrave;nh ch&iacute;nh m&agrave; kh&ocirc;ng cần ph&aacute; dỡ ; thậm ch&iacute; c&oacute; cả trường hợp mặc d&ugrave; x&acirc;y sai ph&eacute;p nhưng bạn kh&ocirc;ng bị phạt cũng kh&ocirc;ng bị ph&aacute; dỡ. Tất cả những điều đ&oacute; đều c&oacute; quy định rất r&otilde;, nhưng nếu như bạn kh&ocirc;ng nắm bắt th&igrave; dĩ nhi&ecirc;n bạn sẽ phải chịu thiệt th&ograve;i về phần m&igrave;nh rồi.</blockquote>\r\n','','','','',154,1,NULL,NULL,NULL,NULL,1),(6,NULL,'Tin tức','tin-tuc','','','','','',190,1,NULL,NULL,NULL,NULL,0),(7,NULL,'Liên hệ','lien-he','<p><iframe frameborder=\"0\" height=\"450\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!